# Correctly set up Chrome WebDriver using webdriver-manager
driver = webdriver.Chrome(service=webdriver.ChromeService(ChromeDriverManager().install()))

# <-------- Alphabet wise Brand and URL collection -------->

alphabets = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z', '*']
brands = {}

base_url = "https://www.fatsecret.com.au/"

for brand_alphabet in alphabets:
	page_number = 0
	brands[brand_alphabet] = []
	print("\n========================================")
	print("Brands With Alphabet: " + str(brand_alphabet))
	while True:
		brand_suffix = "Default.aspx?pa=brands&f=" + brand_alphabet + "&t=1&pg=" + str(page_number)
		url = base_url + brand_suffix
		
		# Navigate to FatSecret
		driver.get(url)
		
		# Convert page source to BeautifulSoup object for parsing
		soup = BeautifulSoup(driver.page_source, 'html.parser')
		
		# Check for 'NO RESULTS FOUND.'
		try:
			if driver.find_element(By.CLASS_NAME, 'resultMetrics').text == "NO RESULTS FOUND.":
				print("--------------------------------------------")
				print("Alphabet " + str(brand_alphabet) + " Ended")
				print("--------------------------------------------\n\n")
				break
		except:
			# Increment the page number to fetch next page in the next iteration
			page_number = page_number + 1
			print("Page Number: " + str(page_number))
			
			# Wait a bit to view the page
			driver.implicitly_wait(5)

			# Extract and print title and href of each link
			for i in driver.find_elements(By.XPATH, './/div[@class="leftCellContent"]//h2//a'):
				
				# Dictioinary of brand with brand name on index 0 and brand page on index 1 of the sub-list
				brands[brand_alphabet].append([i.get_attribute("title"), i.get_attribute("href")])

# Brands product name and URL collection finished
print(brands[brand_alphabet])
print("========================================")

