def extract_calorie_value(text):
    """
    Extracts the calorie value (in kcal) from the given text.
    Assumes the calorie value is mentioned right after the energy value in kj and is followed by "kcal".
    """
    # Split the text into lines for easier processing
    lines = text.split('\n')
    
    # Look for the line containing "kj" as it precedes the calorie value
    for line in lines:
        if "kj" in line.lower():
            # The calorie value is expected to be in the line following the one containing "kj"
            index = lines.index(line) + 1
            if index < len(lines):
                calorie_line = lines[index]
                # Extract the numeric value from the calorie line
                value = ''.join(filter(lambda x: x.isdigit() or x=='.', calorie_line))
                try:
                    # Convert the extracted value to float if possible
                    return float(value)
                except ValueError:
                    # Return None if conversion fails
                    return 0
    # Return None if no calorie value is found
    return 0

def extract_nutritional_values(text):
	# Define the nutrients to look for in the text
	nutrients = ["Energy", "Calories", "Protein", "Fat", "Saturated Fat", "Trans Fat", "Polyunsaturated Fat", "Monounsaturated Fat", "Cholesterol", "Carbohydrates", "Sugar", "Fibre", "Sodium", "Potassium"]
	# Initialize an empty dictionary to store the results
	nutritional_values = {}
	
	# Split the text into lines for easier processing
	lines = text.split('\n')
	
	# Iterate over each nutrient
	for nutrient in nutrients:
		# Look for the nutrient in each line
		for line in lines:
			if nutrient in line:
				# Try to find the value right after the nutrient name, might contain numbers, periods or commas
				index = lines.index(line) + 1 # Value expected in the next line
				value_line = lines[index] if index < len(lines) else ""
				# Extract the numeric value from the value line
				value = ''.join(filter(lambda x: x.isdigit() or x=='.', value_line))
				try:
					# Convert the extracted value to float if possible
					value = float(value)
				except ValueError:
					# Set to None if conversion fails
					value = 0
				nutritional_values[nutrient] = value
				break  # Stop looking for the current nutrient
			else:
				nutritional_values[nutrient] = 0
				
	return nutritional_values

